@Injectable({
  providedIn: 'root'
})


@NgModule({
  declarations: [
    AppComponent,
    RegisterComponent,
    PersondataComponent,
    Kpi3Component,
    BarChartComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,FormsModule, HttpClientModule, ReactiveFormsModule,ChartsModule,CharacterData
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
